import { useState, useEffect } from "react"
import { default as axios } from 'axios'

let iGlobal = 0;
let authCodeGlobal: string|null = null;

export const useShadAPI = (authCode: string|null) => {
  const [intervalId, setIntervalId] = useState<any>();
  const [i, setI] = useState<number>(0);

  useEffect(()=>{
    setI((+localStorage.getItem('i'))||0);
  }, [])

  useEffect(() => {
    if (i != 0) {
      console.log('SET LOCAL STORAGE : ', i);
      localStorage.setItem('i', i);
      iGlobal = i;
    }
  }, [i])

  useEffect(() => {
    authCodeGlobal = authCode;
  }, [authCode])

  return {
    start() {
      setIntervalId(setInterval(() => {
        axios
          .post('https://shbarcode.iranlms.ir/', {
            api_version: '0',
            auth: authCodeGlobal,
            client: {
              app_name: 'Main',
              app_version: '3.2.2',
              lang_code: 'fa',
              package: 'web.shad.ir',
              platform: 'Web'
            },
            data: {
              barcode:'verifystudent',
              input_value: '7',
              track_input: ncList[iGlobal]+'_1385_11',
              type: 'Shad'
            },
            method: 'getBarcodeAction'
          })
          .then(r => {
            console.log(r);
            console.log(r.data.data?.link);
          });
        setI(i=>i+1);
        console.log('IGlobal inside interval: ', iGlobal);
      }, 5000))
    },
    pause() {
      clearInterval(intervalId);
    },
    stop() {
      clearInterval(intervalId);
      localStorage.removeItem('i');
      setI(0);
    },
    i,
    l
  }
}

